    async getCachedEmbeddings(opts: {
        query_table_name: string;
        query_threshold: number;
        query_input: string;
        query_field_name: string;
        query_field_sub_name: string;
        query_match_count: number;
    }): Promise<{
        embedding: number[];
        levenshtein_score: number;
    }[]> {
        // Extract just the message text
        const messageText = opts.query_input
            .split('\n')[0]
            .split(': ').slice(-1)[0]
            .trim();

        console.log("Searching for similar to:", messageText);

        // Just do vector similarity search
        const sql = `
          SELECT *
          FROM memories
          WHERE type = ?
          AND vec_distance_L2(embedding, ?) <= ?
          ORDER BY vec_distance_L2(embedding, ?) ASC
          LIMIT ?
        `;

        // Need to get the real embedding for this text
        // For now using the first memory's embedding format as template
        const sampleMemory = this.db.prepare(
            "SELECT embedding FROM memories WHERE type = ? AND json_extract(content, '$.text') = ? LIMIT 1"
        ).get(opts.query_table_name, messageText);

        if (!sampleMemory) {
            console.log("No exact match found to get embedding format");
            return [];
        }

        console.log("Found sample embedding length:", sampleMemory.embedding.length);

        const memories = this.db.prepare(sql).all(
            opts.query_table_name,
            sampleMemory.embedding,  // Use real embedding as template
            opts.query_threshold || 2,
            sampleMemory.embedding,
            opts.query_match_count
        ) as Memory[];

        console.log("Found similar memories:", memories.length);

        return memories.map((memory) => ({
            embedding: Array.from(new Float32Array(memory.embedding)),
            levenshtein_score: 0
        }));
    } ```

